import React from "react";
import propTypes from "prop-types";
import * as Styled from "./style";

export const PSize = {
  s: "12px",
  m: "14px",
  l: "18px",
};

export const PWeight = {
  xs: 100,
  s: 300,
  m: 500,
  l: 700,
};

const P = ({
  children = "",
  className = "",
  size = PSize.m,
  weight = PWeight.m,
}) => {
  const style = {
    fontSize: size,
    fontWeight: weight,
  };

  return (
    <Styled.P className={className} style={style}>
      {children}
    </Styled.P>
  );
};

P.propTypes = {
  children: propTypes.string,
  className: propTypes.string,
  size: propTypes.string,
  weight: propTypes.number,
};

export default P;
